import React from 'react';

const HorrorIcon = () => {
  return (
    <svg width="50" height="50" viewBox="0 0 50 50" fill="none" xmlns="http://www.w3.org/2000/svg" xmlnsXlink="http://www.w3.org/1999/xlink">
      <rect width="50" height="50" fill="url(#pattern4)"/>
      <defs>
        <pattern id="pattern4" patternContentUnits="objectBoundingBox" width="1" height="1">
          <use xlinkHref="#image4" transform="scale(0.00290698)"/>
        </pattern>
        <image id="image4" width="344" height="344" xlinkHref="data:image/png;base64,"/>
      </defs>
    </svg>
  );
};

export default HorrorIcon;
